import { useNavigate } from "react-router-dom";
import { Container, FacebookIcon, InstagramIcon, MapsIcon, SocialContainer, WhatsappIcon } from "./styles";


function Footer(){

    const navigate = useNavigate();

    return(
        <Container>
            <SocialContainer>
                <FacebookIcon onClick={() => navigate('https://www.facebook.com/andretamiao.adv/')}></FacebookIcon>
                <InstagramIcon></InstagramIcon>
                <WhatsappIcon></WhatsappIcon>
            </SocialContainer>
            <MapsIcon></MapsIcon>
        </Container>
    )
}

export default Footer;
